    "title": "Acerca de mi",
    "description": "Hola, soy Abdul Hamid, un experimentado Desarrollador Full Stack Senior con base en Guadalajara, México. Siempre estoy listo para asumir nuevos desafíos y explorar nuevas tecnologías.",
    "content": "Más allá de mis compromisos profesionales, que puedes seguir en mi [LinkedIn](http://linkedin.com/in/abdulachik/) y [GitHub](https://github.com/abdul-hamid-achik), soy un ávido lector con un interés particular en el psicoanálisis y autores como Jacques Lacan y Fyodor Dostoyevsky. Puedes encontrar mi lista de lectura [aquí](https://www.goodreads.com/abdulhamidachik).\n\nHablo con fluidez inglés y español, con conocimientos básicos de ruso y árabe. Me identifico como un liberal ateo lacaniano, una perspectiva que informa mi enfoque de la vida y el trabajo.\n\nEste sitio web sirve como plataforma para compartir mis ideas, experiencias e historias. Mi objetivo es entretener, educar y aprender junto a mis lectores a través de una mezcla de publicaciones técnicas, reflexiones sobre literatura y filosofía, y narraciones personales.\n\nSi tienes alguna pregunta, quieres charlar o deseas reservar un tiempo para hablar conmigo, no dudes en contactarme en [mi correo](mailto:goad.00potions@icloud.com) o programar una reunión a través de [Cal](https://cal.com/d/tn2bq9am4v5t9TbTF9Mr6C/30min).\n\n¡Siéntete libre de explorar!",
