    "title": "¡Bien hecho, has encontrado oro!",
    "description": "Has sido bloqueado, pero no te preocupes, no todo es tan malo.",
    "content": "Justo como la obra maestra de Gustav Klimt, \"La Mujer en Oro\", has logrado destacar. Desafortunadamente, es porque has sido bloqueado de nuestro sitio web debido a solicitudes excesivas.\n\nApreciamos tu entusiasmo, pero como un museo de bellas artes, debemos proteger nuestros tesoros.\n\nSiéntete libre de regresar una vez que se haya levantado el bloqueo. Hasta entonces, ¿por qué no disfrutas un poco de Klimt?\n\n<Link href=\"/paintings/gustav-klimt-adele-bloch-bauer-I\">\n  <Image className=\"w-full\" width=\"1080\" height=\"489\" src=\"/paintings/Gustav_Klimt_Adele_Bloch-Bauer_I.jpg\"\n         alt=\"Adele Bloch-Bauer I - Gustav Klimt (1907)\"\n         caption=\"Adele Bloch-Bauer I - Gustav Klimt (1907)\"/>\n</Link>",
